    val humble = mutableMapOf<Int, Int>()
    var count = 0
    var num = 1
 
    while (count < limit) {
        if (isHumble(num)) {
            val str = num.toString()
            val len = str.length
            humble.merge(len, 1) { a, b -> a + b }
 
            if (count < 50) print("$num ")
            count++
        }
        num++
    }
    println("\n")
 
    println("Of the first $count humble numbers:")
    num = 1
    while (num < humble.size - 1) {
